import React from "react";
import { Link } from "react-router-dom";
import "../assets/styles.css";
import "../assets/home-dark.css";

import logoNuevo from "../assets/img/logonuevo.png";

export default function Home() {
  React.useEffect(() => {
    document.body.classList.add("has-video-bg");
    return () => document.body.classList.remove("has-video-bg");
  }, []);

  return (
    <div className="home-dark has-video-bg">
      <header className="TopBar TopBar--home">
        <nav className="TopBar-links TopBar-links--left" aria-label="NavegaciÃ³n">
          <Link to="/reglas" className="nav-btn">Rules</Link>
          <Link to="/equipos" className="nav-btn">Teams</Link>
          <Link to="/events" className="nav-btn">Stats</Link>
        </nav>
      </header>

      <main className="home-hero">
        <img className="home-hero-logo" src={logoNuevo} alt="Rustaco" />
        <div
          style={{
            marginTop: "0.8rem",
            display: "flex",
            justifyContent: "center",
          }}
        >
          <div
            style={{
              padding: "0.65rem 1.6rem",
              borderRadius: 999,
              background:
                "linear-gradient(90deg, rgba(0,0,0,0.75), rgba(226,88,34,0.35))",
              border: "1px solid rgba(255,255,255,0.18)",
              boxShadow: "0 10px 32px rgba(0,0,0,0.75)",
              display: "inline-flex",
              alignItems: "center",
              gap: 10,
            }}
          >
            <span
              style={{
                textTransform: "uppercase",
                fontSize: "0.75rem",
                letterSpacing: "2px",
                color: "rgba(255,255,255,0.85)",
                fontWeight: 800,
              }}
            >
              Rustaco III
            </span>
            <span
              style={{
                color: "#fff",
                fontWeight: 800,
                fontSize: "1.15rem",
                letterSpacing: "1px",
                textShadow: "0 2px 10px #000",
              }}
            >
              February 26 to March 1
            </span>
          </div>
        </div>
      </main>
    </div>
  );
}
